import React, { Component } from "react";
import "./ItemInfo.scss";

class ItemInfo extends Component {
  render() {
    return (
      <div className="ItemInfo">
        <div className="mainCopy">역사 속 신발을 가져오다</div>
        <div className="content">
          에어 조던 5의 30주년을 기념하는 이 레트로 버전은 클래식 에어 쿠셔닝,
          프리미엄 소재, AJ5를 곧바로 클래식으로 만들어 준 아이코닉 디자인
          디테일을 갖추고 있습니다.
        </div>
        <div className="colorNstyle">
          <span className="color">
            현재 컬러 : 화이트/고스트 그린/코트 퍼플
          </span>
          <span className="style">스타일 : DB3335-100</span>
          <span>더 보기 </span>
        </div>
      </div>
    );
  }
}

export default ItemInfo;
